import React, { useState } from "react";
import { Link } from "react-router-dom";
import pic from "../images/subscription.jpg";
import { useDispatch } from "react-redux";
import { initiatePaypalPayment } from "../actions/userActions";

function Subscription() {
  const [selectedPlan, setSelectedPlan] = useState(null);
  const dispatch = useDispatch();

  const handlePaypalPayment = () => {
    if (selectedPlan) {
      dispatch(initiatePaypalPayment(selectedPlan));
    }
  };

  return (
    <div
      style={{
        position: "relative",
        height: "100vh",
        width: "100vw",
        overflow: "hidden",
      }}
      onClick={() => setSelectedPlan(null)}
    >
      <div
        style={{
          content: "",
          position: "absolute",
          top: 0,
          left: 0,
          width: "100%",
          height: "100%",
          opacity: "0.66",
          backgroundImage: `url(${pic})`,
          backgroundPosition: "center",
          backgroundSize: "cover",
          backgroundRepeat: "no-repeat",
          zIndex: -1,
        }}
      />
      <div style={{ margin: "2.4vw", position: "relative" }}>
        <h1
          style={{
            color: "#004cff",
            fontSize: "12vw",
            margin: 0,
            position: "absolute",
            top: "-5vw",
            padding: 0,
          }}
        >
          인뱅
        </h1>
        <h2
          style={{
            color: "#004cff",
            position: "absolute",
            fontSize: "1.6vw",
            top: "7vw",
            left: "20vw",
            transform: "rotate(-24deg)",
          }}
        >
          In-Bang
        </h2>
        <p style={{ color: "#ffffff", fontSize: "2.4vw", fontWeight: "bold" }}>
          <br />
          <br />
          <br />
          <br />
          <br />
          Choose your stated plan
        </p>
        <p style={{ color: "#ffffff", fontSize: "1.8vw" }}>
          /Ad free.
          <br />
          /Change or cancel plans anytime.
        </p>
        <table
          style={{
            backgroundColor: "#1200b8",
            color: "#ffffff",
            marginTop: "1vw",
            marginLeft: "auto",
            marginRight: "auto",
          }}
        >
          <tbody>
            <tr>
              <td style={{ padding: "2vw", textAlign: "center" }}></td>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                <button
                  style={{
                    cursor: "pointer",
                    backgroundColor:
                      selectedPlan === "Standard" ? "#b700ff" : "#3700ff",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "3vw",
                    fontSize: "2vw",
                    padding: "1vw 2vw",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Standard");
                  }}
                >
                  Standard
                </button>
              </td>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                <button
                  style={{
                    cursor: "pointer",
                    backgroundColor:
                      selectedPlan === "Premium" ? "#b700ff" : "#3700ff",
                    color: "#ffffff",
                    border: "none",
                    marginTop: "3vw",
                    fontSize: "2vw",
                    padding: "1vw 2vw",
                  }}
                  onClick={(e) => {
                    e.stopPropagation();
                    setSelectedPlan("Premium");
                  }}
                >
                  Premium
                </button>
              </td>
            </tr>
            <tr>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                Monthly Price
              </td>
              <td style={{ padding: "2vw", textAlign: "center" }}>₱250</td>
              <td style={{ padding: "2vw", textAlign: "center" }}>₱530</td>
            </tr>
            <tr>
              <td style={{ padding: "2vw", textAlign: "center" }}>
                Video Quality
              </td>
              <td style={{ padding: "2vw", textAlign: "center" }}>HD</td>
              <td style={{ padding: "2vw", textAlign: "center" }}>Ultra HD</td>
            </tr>
          </tbody>
        </table>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "2vw",
          }}
        >
          <button
            onClick={handlePaypalPayment}
            style={{
              cursor: "pointer",
              border: "0.2vw solid rgba(0, 0, 0, 1)",
              backgroundColor: "rgba(0, 0, 0, 1)",
              borderRadius: "0.5vw",
              color: "#ffffff",
              padding: "1vw",
              fontSize: "1.8vw",
              marginRight: "1vw",
            }}
          >
            Pay with PayPal
          </button>
          <Link to="/login">
            <button
              style={{
                cursor: "pointer",
                border: "0.2vw solid rgba(0, 0, 0, 1)",
                backgroundColor: "rgba(0, 0, 0, 1)",
                borderRadius: "0.5vw",
                color: "#ffffff",
                padding: "1vw",
                fontSize: "1.8vw",
              }}
            >
              Next
            </button>
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Subscription;
